import Foundation

// Example 1:
// Input: s = "abc", t = "ahbgdc"
// Output: true
//
// Example 2:
// Input: s = "axc", t = "ahbgdc"
// Output: false

class Solution {
    func isSubsequence(_ s: String, _ t: String) -> Bool {
        guard !t.contains(s) else {
            return true
        }
        let modifiedT = t.reduce(into: t) { partialResult, char in
            if !s.contains(char) {
                partialResult.removeAll(where: { $0 == char })
            }
        }
        guard modifiedT.count >= s.count else {
            return modifiedT == s
        }
        let uniqueS = s.reduce(into: "") { partialResult, char in
            if !partialResult.contains(char) {
                partialResult += String(char)
            }
        }
        let uniqueModifiedT = modifiedT.reduce(into: "") { partialResult, char in
            if !partialResult.contains(char) {
                partialResult += String(char)
            }
        }
        return uniqueS == uniqueModifiedT
    }
}

let solution = Solution()
var testCase: (String, String) = ("abc", "ahbgdc")
var result = solution.isSubsequence(testCase.0, testCase.1)

testCase = ("axc", "ahbgdc")
result = solution.isSubsequence(testCase.0, testCase.1)

testCase = ("acb", "ahbgdc")
result = solution.isSubsequence(testCase.0, testCase.1)

testCase = ("ab", "baab")
result = solution.isSubsequence(testCase.0, testCase.1)

testCase = ("aaaaaa", "bbaaaa")
result = solution.isSubsequence(testCase.0, testCase.1)

testCase = ("leeeeetcode", "")
result = solution.isSubsequence(testCase.0, testCase.1)
